import '../css/login.css';
import logo from '../images/sign-up-logo.png'

const Login = () => {
    return ( 
        <div className="login-container">
            <div className="left">
                <div className="sign-up-logo-container">

                </div>
                <img src={logo} alt="" />

            </div>
            <div className="right">

            </div>


        </div>
     );
}

export default Login;
